import React, { Component } from 'react';

 class Keybord extends Component {
 render() {
  return(
      <div>
          {
            this.props.alphabet.map(
                (letter, index) => {
                    return <button key={index}
                                   onClick={() => action(letter)}
                    >{letter}</button>
                }
            )
          }
      </div>
  )
}
}

export default Keybord;
